import Item from "./components/Item";

function App() {
  const items = [
    {
      id: 1,
      title: "Plane Tickets",
      cost: 450,
      date: new Date(2023, 2, 1).toTimeString,
    },
    {
      id: 2,
      title: "MacDonalds",
      cost: 5,
      date: new Date(2023, 5, 1).toTimeString,
    },
    {
      id: 3,
      title: "Headphones",
      cost: 80,
      date: new Date(2023, 11, 1).toTimeString,
    },
    {
      id: 4,
      title: "Chocolate Bar",
      cost: 10,
      date: new Date(2023, 15, 1).toTimeString,
    },
  ];
  return (
    <div>
      <h1>Let's get started!</h1>
      <Item></Item>
    </div>
  );
}

export default App;
